  | TokenRBRACE
  | TokenLBRACKET
  | TokenRBRACKET
  | TokenLPAREN
  | TokenRPAREN
  | TokenConst String
  | TokenIdent String
  | TokenInt Int
  | TokenDouble Double
  deriving (Eq, Show)
	

type TokenPos = (Int, Int)

tok :: (String -> Token) -> AlexPosn -> String -> (TokenPos, Token)
tok f a s = (a2tp a, f s)

